from scipy.special import erfcx  # requires numba-scipy
import numpy as np
import numba as nb
import Z2
import Z1


# ======================================== F3 ========================================
@nb.njit
def antisymmetric_erfcx(x):
    if x < 0:
        return -erfcx(-x)
    return erfcx(x)


@nb.njit
def __sum_F3(n0, arg_func_linear, arg_func_const, func, arg0_exp, delta_arg_exp, NMAX, h):
    n1 = n0+1
    n2 = n0-1

    arg1 = arg_func_linear*n1+arg_func_const
    arg2 = arg_func_linear*n2+arg_func_const

    e1 = np.exp(arg0_exp + .5*delta_arg_exp)
    e2 = np.exp(arg0_exp - .5*delta_arg_exp)
    delta_exp = np.exp(delta_arg_exp)

    S = 0
    for i in range(NMAX):
        n = 2*i+1
        delta = func(arg1)*e1*np.exp(-h**2*n**2)/n1
        S += delta

        n = -2*i-1
        delta = func(arg2)*e2*np.exp(-h**2*n**2)/n2
        S += delta

        n1 += 2
        n2 -= 2
        arg1 = arg_func_linear*n1+arg_func_const
        arg2 = arg_func_linear*n2+arg_func_const
        e1 *= delta_exp
        e2 /= delta_exp

    return S


@nb.njit
def _term1_F3(func, x, a, b, c, _sqrt_c, NMAX, h):
    xx = (a*x + b)/h
    n0 = 2*np.int_(0.5*xx+np.sign(xx)*0.5)
    arg0_exp = 2*b*h*n0-h**2*n0**2+2*a*h*n0*x-2*a*b*x+c*x**2-b**2-x**2
    delta_arg_exp = 4*a*h*x + 4*b*h - 4*h**2*n0
    return __sum_F3(n0, a*h*_sqrt_c, (-a*b + c*x)*_sqrt_c, func, arg0_exp, delta_arg_exp, NMAX, h)


@nb.njit
def _term2_F3(func, x, a, b, _sqrt_c, NMAX, h):
    xx = b/h
    n0 = 2*np.int_(0.5*xx+np.sign(xx)*0.5)
    arg0_exp = 2*b*h*n0-h**2*n0**2-b**2-x**2
    delta_arg_exp = 4*b*h - 4*h**2*n0
    return __sum_F3(n0, a*h*_sqrt_c, -a*b*_sqrt_c, func, arg0_exp, delta_arg_exp, NMAX, h)


@nb.njit
def F3(x, a, b, NMAX=None, h=None):
    if np.isnan(x) or np.isnan(a) or np.isnan(b):
        return np.nan
    if np.isinf(x) or np.isinf(a) or np.isinf(b):
        return np.nan

    c = 1-a**2

    if c == 1:
        return Z2.F2(x) * Z2.F2(b)

    if c > 0:
        if NMAX is None:
            NMAX = 6
        if h is None:
            h = 0.4

        sqrt_c = np.sqrt(c)
        _sqrt_c = 1/sqrt_c

        S = _term1_F3(Z2.F2, x, a, b, c, _sqrt_c, NMAX, h)
        S -= _term2_F3(Z2.F2, x, a, b, _sqrt_c, NMAX, h)

        return S/np.sqrt(np.pi)*_sqrt_c

    if c < 0:
        if NMAX is None:
            NMAX = 6
        if h is None:
            h = 0.4

        sqrt_c = np.sqrt(-c)
        _sqrt_c = 1/sqrt_c

        S = _term1_F3(antisymmetric_erfcx, x, a, b, c, _sqrt_c, NMAX, h)
        S -= _term2_F3(antisymmetric_erfcx, x, a, b, _sqrt_c, NMAX, h)

        factor = -2*np.sign(a)
        left, right = (a*b - c*x)/(a*h), b/h
        if left != right:
            if right < left:
                factor *= -1
                left, right = right, left

            n_prob = (left+right)/2
            start, end = left, right
            if a**2*b/c - a**2*h*n_prob/c + b - h*n_prob > 0:
                start, end = end, start

            step = 2*np.sign(end-start)

            n = np.floor(start)
            n = n - 1 + n % 2
            distance = np.abs(end-start)
            if np.abs(n-end) > distance:
                n += step

            def arg_exp(n): return (-a**2*b**2 + 2*a**2*b*h*n - a**2*h**2*n**2)/c - b**2 + 2*b*h*n - h**2*n**2 - x**2
            while True:
                if max(np.abs(n-start), np.abs(n-end)) > distance:
                    break
                if n == left:
                    if a < 0:
                        S -= factor*np.exp(arg_exp(n))/n
                if n == right:
                    if a < 0:
                        S += factor*np.exp(arg_exp(n))/n
                    n += step
                    continue

                val_exp = np.exp(arg_exp(n))
                S += factor*val_exp/n
                n += step

                if np.abs(factor*val_exp/n) - 1e-7*np.abs(S) < 0:
                    break

        return S*.5*_sqrt_c

    # c == 0
    if b == 0:
        return x*Z2.F2(x) - .5*(1-np.exp(-x**2))

    # b != 0
    result = Z2.F2(b)*np.exp(-x**2)
    result += Z2.F2(x)
    result -= Z2.F2(b+x)
    return result*.5/b


# ======================================== BASE ========================================
SIGMAS = np.asarray([-1, 1])


@nb.njit
def _Z3_sum_terms(terms, sigmas_func, *sigmas_args):
    result = 0
    for i1, s1 in enumerate(SIGMAS):
        for i2, s2 in enumerate(SIGMAS):
            for i3, s3 in enumerate(SIGMAS):
                result += sigmas_func(s1, s2, s3, *sigmas_args)*terms[i1, i2, i3]
    return result


@nb.njit
def _Z3_E_terms_norm(h_i, h_j, l_ij, l_ik):
    result = np.zeros((2, 2, 2))
    for i1, s1 in enumerate(SIGMAS):
        for i2, s2 in enumerate(SIGMAS):
            for i3, s3 in enumerate(SIGMAS):
                arg = s3*h_j+s1*s2*l_ik+(s1+s2)*(h_i+s3*l_ij)-h_j-l_ik-2*(h_i+l_ij)
                result[i1, i2, i3] = np.exp(arg)
    return result


@nb.njit
def _Z3_F3_terms(h_i, h_j, l_ij, l_ik):
    def _arg1(s1, s2, s3): return (h_i+s3*l_ij+(s1+s2)*h_i/h_j*l_ij)/np.sqrt(2*h_i/h_j*l_ij)
    _arg2 = np.sqrt(h_i/h_j*l_ij/l_ik)
    def _arg3(s1, s2): return (s1+s2)/np.sqrt(2*l_ik)*(l_ik-h_i/h_j*l_ij)
    result = np.zeros((2, 2, 2))
    for i1, s1 in enumerate(SIGMAS):
        for i2, s2 in enumerate(SIGMAS):
            for i3, s3 in enumerate(SIGMAS):
                args = _arg1(s1, s2, s3), _arg2, _arg3(s1, s2)
                result[i1, i2, i3] = F3(*args)
    return result


@nb.njit
def _Z3_F_tilde_terms(h_i, h_j, l_ij, l_ik):
    result = np.zeros((2, 2, 2))
    for i1, s1 in enumerate(SIGMAS):
        for i2, s2 in enumerate(SIGMAS):
            for i3, s3 in enumerate(SIGMAS):
                arg = (h_i+s3*l_ij+(s1+s2)*l_ik)/np.sqrt(2*l_ik)
                result[i1, i2, i3] = Z2.F2(arg)
    return result


@nb.njit
def _Z3_F_terms(h_i, h_j, l_ij, l_ik):
    result = np.zeros((2, 2, 2))
    for i1, s1 in enumerate(SIGMAS):
        for i2, s2 in enumerate(SIGMAS):
            for i3, s3 in enumerate(SIGMAS):
                arg = (h_i+s3*l_ij+(s1+s2)*h_i/h_j*l_ij) / np.sqrt(2*h_i/h_j*l_ij)
                result[i1, i2, i3] = Z2.F2(arg)
    return result


@nb.njit
def cF3Function_norm(h_i, h_j, l_ij, l_ik):
    _E_terms = _Z3_E_terms_norm(h_i, h_j, l_ij, l_ik)
    _F3_terms = _Z3_F3_terms(h_i, h_j, l_ij, l_ik)
    _terms = _E_terms*_F3_terms
    def _sigmas_func_123(s1, s2, s3, *sigmas_args): return s1*s2*s3
    return _Z3_sum_terms(_terms, _sigmas_func_123, 1, 1, 1)


@nb.njit
def EFunction_norm(h_i, h_j, l_ij, l_ik, arg_s1, arg_s2, arg_s3):
    def _sigmas_func(s1, s2, s3, arg_s1, arg_s2, arg_s3): return (s1 if arg_s1 else 1)*(s2 if arg_s2 else 1)*(s3 if arg_s3 else 1)
    return _Z3_sum_terms(_Z3_E_terms_norm(h_i, h_j, l_ij, l_ik), _sigmas_func, arg_s1, arg_s2, arg_s3)


@nb.njit
def FTildeFunction_norm(h_i, h_j, l_ij, l_ik, arg_s1, arg_s2, arg_s3):
    def _sigmas_func(s1, s2, s3, arg_s1, arg_s2, arg_s3): return (s1 if arg_s1 else 1)*(s2 if arg_s2 else 1)*(s3 if arg_s3 else 1)
    terms = _Z3_E_terms_norm(h_i, h_j, l_ij, l_ik)*_Z3_F_tilde_terms(h_i, h_j, l_ij, l_ik)
    return _Z3_sum_terms(terms, _sigmas_func, arg_s1, arg_s2, arg_s3)


@nb.njit
def FFunction_norm(h_i, h_j, l_ij, l_ik, arg_s1, arg_s2, arg_s3):
    def _sigmas_func(s1, s2, s3, arg_s1, arg_s2, arg_s3): return (s1 if arg_s1 else 1)*(s2 if arg_s2 else 1)*(s3 if arg_s3 else 1)
    terms = _Z3_E_terms_norm(h_i, h_j, l_ij, l_ik)*_Z3_F_terms(h_i, h_j, l_ij, l_ik)
    return _Z3_sum_terms(terms, _sigmas_func, arg_s1, arg_s2, arg_s3)


# ======================================== MOMENTS ========================================
M_SQRT2 = np.sqrt(2)


def calc_Z3_norm(h_i, h_j, l_ij, l_ik):
    return 2*(2*np.pi)**3/np.sqrt(h_i*h_j*l_ij*l_ik)*cF3Function_norm(h_i, h_j, l_ij, l_ik)


def calc_m_i(h_i, h_j, l_ij, l_ik):
    if h_i == h_j and l_ij == l_ik:
        h, l = h_i, l_ij
        return -1.0/3.0*h/l + (1.0/6.0)*M_SQRT2*FFunction_norm(h, h, l, l, 1, 1, 1)/(np.sqrt(l)*cF3Function_norm(h, h, l, l)) - (1.0/3.0)/h
    if abs(l_ij*h_i - l_ik*h_j) < 1e-12:
        return np.nan
    cF3 = cF3Function_norm(h_i, h_j, l_ij, l_ik)
    return -np.sqrt(l_ij)*np.sqrt(l_ik)*np.sqrt(h_j)*EFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 1)/(8*np.sqrt(h_i)*(l_ij*h_i - l_ik*h_j)*cF3) + M_SQRT2*np.sqrt(l_ij)*l_ik*h_j**(3/2)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 0)/(8*h_i**(3/2)*(l_ij*h_i - l_ik*h_j)*cF3) + M_SQRT2*np.sqrt(l_ij)*np.sqrt(h_i)*np.sqrt(h_j)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 1)/(4*(l_ij*h_i - l_ik*h_j)*cF3) + l_ij**2*h_j/(4*h_i*(l_ij*h_i - l_ik*h_j)) + M_SQRT2*l_ij*np.sqrt(l_ik)*FFunction_norm(h_i, h_j, l_ij, l_ik, 1, 0, 1)/(4*(l_ij*h_i - l_ik*h_j)*cF3) - l_ij*l_ik*h_j**2/(4*h_i**2*(l_ij*h_i - l_ik*h_j)) - l_ij/(4*(l_ij*h_i - l_ik*h_j)) - h_i*h_j/(4*(l_ij*h_i - l_ik*h_j)) - 1/(4*h_i) + l_ik*h_j**2/(4*l_ij*(l_ij*h_i - l_ik*h_j)) - M_SQRT2*l_ik*h_j**(3/2)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 1)/(8*np.sqrt(l_ij)*np.sqrt(h_i)*(l_ij*h_i - l_ik*h_j)*cF3)


def calc_m_j(h_i, h_j, l_ij, l_ik):
    if h_i == h_j and l_ij == l_ik:
        h, l = h_i, l_ij
        return -1.0/3.0*h/l + (1.0/6.0)*M_SQRT2*FFunction_norm(h, h, l, l, 1, 1, 1)/(np.sqrt(l)*cF3Function_norm(h, h, l, l)) - (1.0/3.0)/h
    if abs(l_ij*h_i - l_ik*h_j) < 1e-12:
        return np.nan
    cF3 = cF3Function_norm(h_i, h_j, l_ij, l_ik)
    return np.sqrt(l_ij)*np.sqrt(l_ik)*np.sqrt(h_i)*EFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 1)/(4*np.sqrt(h_j)*(l_ij*h_i - l_ik*h_j)*cF3) - M_SQRT2*np.sqrt(l_ij)*l_ik*np.sqrt(h_j)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 0)/(4*np.sqrt(h_i)*(l_ij*h_i - l_ik*h_j)*cF3) - l_ij**2/(2*(l_ij*h_i - l_ik*h_j)) - M_SQRT2*l_ij*np.sqrt(l_ik)*h_i*FFunction_norm(h_i, h_j, l_ij, l_ik, 1, 0, 1)/(2*h_j*(l_ij*h_i - l_ik*h_j)*cF3) + l_ij*l_ik*h_j/(2*h_i*(l_ij*h_i - l_ik*h_j)) + l_ij*h_i/(2*h_j*(l_ij*h_i - l_ik*h_j)) - h_i**2/(2*(l_ij*h_i - l_ik*h_j)) - 1/(2*h_j) + l_ik*h_i*h_j/(2*l_ij*(l_ij*h_i - l_ik*h_j)) - M_SQRT2*l_ik*np.sqrt(h_i)*np.sqrt(h_j)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 1)/(4*np.sqrt(l_ij)*(l_ij*h_i - l_ik*h_j)*cF3)


def calc_eta_ij(h_i, h_j, l_ij, l_ik):
    if h_i == h_j and l_ij == l_ik:
        h, l = h_i, l_ij
        return (1.0/6.0)*h**(2)/l**(2) - 1.0/12.0*M_SQRT2*h*FFunction_norm(h, h, l, l, 1, 1, 1)/(np.sqrt(l)* (l)*cF3Function_norm(h, h, l, l)) - 0.5 - (1.0/3.0)/l + (0.25)*M_SQRT2*FFunction_norm(h, h, l, l, 1, 1, 0)/(np.sqrt(l)*cF3Function_norm(h, h, l, l))
    if abs(l_ij*h_i - l_ik*h_j) < 1e-12:
        return np.nan
    cF3 = cF3Function_norm(h_i, h_j, l_ij, l_ik)
    return M_SQRT2*np.sqrt(l_ij)*np.sqrt(h_i)*np.sqrt(h_j)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 0)/(4*(l_ij*h_i - l_ik*h_j)*cF3) - l_ij*h_j/(4*(l_ij*h_i - l_ik*h_j)) + M_SQRT2*np.sqrt(l_ik)*h_i*FFunction_norm(h_i, h_j, l_ij, l_ik, 1, 0, 1)/(4*(l_ij*h_i - l_ik*h_j)*cF3) + l_ik*h_j**2/(4*h_i*(l_ij*h_i - l_ik*h_j)) - h_i/(4*(l_ij*h_i - l_ik*h_j)) + h_i**2*h_j/(4*l_ij*(l_ij*h_i - l_ik*h_j)) - 1/(4*l_ij) - l_ik*h_i*h_j**2/(4*l_ij**2*(l_ij*h_i - l_ik*h_j)) - np.sqrt(l_ik)*np.sqrt(h_i)*np.sqrt(h_j)*EFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 1)/(8*np.sqrt(l_ij)*(l_ij*h_i - l_ik*h_j)*cF3) - M_SQRT2*l_ik*h_j**(3/2)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 0)/(8*np.sqrt(l_ij)*np.sqrt(h_i)*(l_ij*h_i - l_ik*h_j)*cF3) + M_SQRT2*l_ik*np.sqrt(h_i)*h_j**(3/2)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 1)/(8*l_ij**(3/2)*(l_ij*h_i - l_ik*h_j)*cF3)


def calc_eta_ik(h_i, h_j, l_ij, l_ik):
    if h_i == h_j and l_ij == l_ik:
        h, l = h_i, l_ij
        return (1.0/6.0)*h**(2)/l**(2) - 1.0/12.0*M_SQRT2*h*FFunction_norm(h, h, l, l, 1, 1, 1)/(np.sqrt(l)* (l)*cF3Function_norm(h, h, l, l)) - 0.5 - (1.0/3.0)/l + (0.25)*M_SQRT2*FFunction_norm(h, h, l, l, 1, 1, 0)/(np.sqrt(l)*cF3Function_norm(h, h, l, l))
    if abs(l_ij*h_i - l_ik*h_j) < 1e-12:
        return np.nan
    cF3 = cF3Function_norm(h_i, h_j, l_ij, l_ik)
    return -M_SQRT2*l_ij**(3/2)*np.sqrt(h_i)*np.sqrt(h_j)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 0)/(4*l_ik*(l_ij*h_i - l_ik*h_j)*cF3) - M_SQRT2*np.sqrt(l_ij)*h_i**(3/2)*np.sqrt(h_j)*FTildeFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 1)/(4*l_ik*(l_ij*h_i - l_ik*h_j)*cF3) + np.sqrt(l_ij)*np.sqrt(h_i)*np.sqrt(h_j)*EFunction_norm(h_i, h_j, l_ij, l_ik, 1, 1, 1)/(4*np.sqrt(l_ik)*(l_ij*h_i - l_ik*h_j)*cF3) - l_ij*h_i/(l_ij*h_i - l_ik*h_j) + l_ij*h_i/(2*l_ik*(l_ij*h_i - l_ik*h_j)) - M_SQRT2*np.sqrt(l_ik)*h_j*FFunction_norm(h_i, h_j, l_ij, l_ik, 1, 0, 1)/(2*(l_ij*h_i - l_ik*h_j)*cF3) + l_ik*h_j/(l_ij*h_i - l_ik*h_j) - 1/(2*l_ik)


def calc_m_j_eta_ij(m_i, m_j, eta_ij, eta_ik, h_i, h_j, l_ij, l_ik):
    if h_i == h_j and l_ij == l_ik:
        m, eta = m_i, eta_ij
