@nb.njit(parallel=True)
def find_coeffs_vectorize(m, eta_ij, eta_ik, eps=1e-8):
    h_i, h_j = np.empty_like(m), np.empty_like(m)
    l_ij, l_ik = np.empty_like(m), np.empty_like(m)

    for i in nb.prange(m.size):
        result = find_coeffs_single(m.flat[i], eta_ij.flat[i], eta_ik.flat[i], eps)
        h_i.flat[i] = result[0]
        h_j.flat[i] = result[1]
        l_ij.flat[i] = result[2]
        l_ik.flat[i] = result[3]

    return h_i, h_j, l_ij, l_ik


def find_coeffs(m, eta_ij, eta_ik, eps=1e-8):
    if isinstance(m, np.ndarray):
        return find_coeffs_vectorize(m,  eta_ij, eta_ik, eps)
    else:
        return find_coeffs_single(m, eta_ij, eta_ik, eps)


